class Solution(object):
    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(index, prev, cur, value, s):
            if index == len(num):
                if value == target and cur == 0:
                    ans.append(s)
                return
            for j in range(index, len(num)):
                if j > index and num[index] == '0':
                    break
                cur = cur * 10 + int(num[j])
                if index == 0:
                    backtrack(j + 1, cur, 0, cur, s + str(cur))
                else:
                    backtrack(j + 1, prev * cur, 0, value - prev + prev * cur, s + '*' + str(cur))
                    backtrack(j + 1, -cur, 0, value - prev - cur, s + '-' + str(cur))
                    backtrack(j + 1, cur, 0, value - prev + cur, s + '+' + str(cur))

        ans = []
        backtrack(0, 0, 0, 0, "")
        return ans

