longest-consecutive-sequence.solution:
class Solution(object):
    def longestConsecutive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        if not nums:
            return 0

        nums = set(nums)
        max_len = 0

        for num in nums:
            if num - 1 not in nums:
                curr_num = num
                curr_len = 1

                while curr_num + 1 in nums:
                    curr_num += 1
                    curr_len += 1

                max_len = max(max_len, curr_len)

        return max_len

