class Solution(object):
    def maximumGap(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) < 2:
            return 0
        max_val, min_val = max(nums), min(nums)
        if max_val == min_val:
            return 0
        bucket_size = (max_val - min_val) // (len(nums) - 1) or 1
        bucket_num = (max_val - min_val) // bucket_size + 1
        buckets = [None] * bucket_num
        for num in nums:
            idx = (num - min_val) // bucket_size
            bucket = buckets[idx]
            if bucket is None:
                bucket = {'min': num, 'max': num}
                buckets[idx] = bucket
            else:
                bucket['min'] = min(bucket['min'], num)
                bucket['max'] = max(bucket['max'], num)
        max_gap = 0
        prev_max = min_val
        for bucket in buckets:
            if bucket:
                max_gap = max(max_gap, bucket['min'] - prev_max)
                prev_max = bucket['max']
        return max_gap

