class Solution(object):
    def minSwapsCouples(self, row):
        """
        :type row: List[int]
        :rtype: int
        """

        N = len(row) // 2
        parent = list(range(2*N))
        rank = [0] * (2*N)

        def find(x):
            if parent[x] != x:
                parent[x] = find(parent[x])
            return parent[x]

        def union(x, y):
            xr = find(x)
            yr = find(y)
            if rank[xr] < rank[yr]:
                parent[xr] = yr
            elif rank[xr] > rank[yr]:
                parent[yr] = xr
            else:
                parent[yr] = xr
                rank[xr] += 1

        for i in range(0, len(row), 2):
            union(row[i], row[i+1])

        count = collections.Counter(find(x) for x in parent)
        return sum(v // 2 - 1 for v in count.values())

