class Solution(object):
    def minSwapsCouples(self, row):
        """
        :type row: List[int]
        :rtype: int
        """

        N = len(row) // 2
        uf = {i: i for i in range(N)}
        weight = {i: 1 for i in range(N)}

        def find(x):
            if uf[x] != x:
                uf[x] = find(uf[x])
            return uf[x]

        def union(x, y):
            xr = find(x)
            yr = find(y)
            if xr == yr: return 0
            if weight[xr] < weight[yr]:
                xr, yr = yr, xr
            uf[yr] = xr
            weight[xr] += weight[yr]
            return 1

        swaps = sum(union(i // 2, (row[i] // 2)) for i in range(0, len(row), 2))
        return N - swaps

