                i = j = mid + 1
                for left in prefix[l:mid+1]:
                    while i < j and prefix[j] - left < lower: j += 1
                    while i < j and prefix[j] - left <= upper: i += 1
                    count += i - j
                prefix[l:j] = sorted(prefix[l:j])
                return count

