class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """

        if len(s) > len(t):
            return False
        if len(s) == 0:
            return True
        subsequence = 0
        for i in range(0, len(t)):
            if subsequence <= len(s) - 1:
                if s[subsequence] == t[i]:
                    subsequence += 1
        return subsequence == len(s)

