class Solution(object):
    def multiply(self, num1, num2):
        """
        :type num1: str
        :type num2: str
        :rtype: str
        """

        def strToInt(s):
            num = 0
            for ch in s:
                num = num * 10 + (ord(ch) - ord('0'))
            return num

        def intToStr(num):
            s = ""
            while num:
                s = chr(num % 10 + ord('0')) + s
                num //= 10
            return s

        return intToStr(strToInt(num1) * strToInt(num2))

