preimage-size-of-factorial-zeroes-functi.solution:
class Solution(object):
    def preimageSizeFZF(self, k):
        """
        :type k: int
        :rtype: int
        """

        def count_zero(n):
            cnt = 0
            while n > 0:
                n /= 5
                cnt += n
            return cnt

        left, right = 0, 5 * k
        while left < right:
            mid = (left + right) // 2
            if count_zero(mid) < k:
                left = mid + 1
            else:
                right = mid
        return 5 if count_zero(left) == k else 0

