class Solution(object):
    def containVirus(self, isInfected):
        """
        :type isInfected: List[List[int]]
        :rtype: int
        """

        def get_neighbors(r, c):
            for i, j in [(r-1, c), (r+1, c), (r, c-1), (r, c+1)]:
                if 0 <= i < m and 0 <= j < n:
                    yield i, j

        def dfs(r, c):
            for i, j in get_neighbors(r, c):
                if isInfected[i][j] == 1:
                    yield i, j
                    isInfected[i][j] = -1
                    for x, y in dfs(i, j):
                        yield x, y
                elif isInfected[i][j] == 0:
                    yield i, j
                    walls[r][c] += 1

        def build_wall():
            r, c = max((len(list(dfs(i, j))), i, j) for i in range(m) for j in range(n) if isInfected[i][j] == 1)
            walls[r][c] = -1
            list(dfs(r, c))

        def disinfect():
            for i in range(m):
                for j in range(n):
                    if isInfected[i][j] == 1:
                        isInfected[i][j] = 2

        def count_walls():
            return sum(sum(row) for row in walls)

