class Solution(object):
    def countDigitOne(self, n):
        """
        :type n: int
        :rtype: int
        """

        if n == 0:
            return 0
        if n < 10:
            return 1
        l = len(str(n))
        p = 10 ** (l - 1)
        m, r = divmod(n, p)
        if m == 1:
            return r + 1 + self.countDigitOne(p - 1) + self.countDigitOne(r)
        else:
            return p + m * self.countDigitOne(p - 1) + self.countDigitOne(r)

