class Solution(object):
    def wordBreak(self, s, wordDict):
        """
        :type s: str
        :type wordDict: List[str]
        :rtype: List[str]
        """

        wordSet = set(wordDict)
        memo = {}
        def dp(i):
            if i in memo:
                return memo[i]
            ans = []
            for j in range(i+1, len(s)+1):
                if s[i:j] in wordSet:
                    if j == len(s):
                        ans.append(s[i:j])
                    else:
                        for tail in dp(j):
                            ans.append(s[i:j] + ' ' + tail)
            memo[i] = ans
            return ans
        return dp(0)

