class Solution(object):
    def readBinaryWatch(self, turnedOn):
        """
        :type turnedOn: int
        :rtype: List[str]
        """

        def count_bits(n):
            count = 0
            while n:
                n &= n - 1
                count += 1
            return count

        res = []
        for h in range(12):
            for m in range(60):
                if count_bits(h) + count_bits(m) == turnedOn:
                    res.append(f"{h}:{m:02d}")
        return res

