                pascal[n][k] = pascal[n-1][k-1] + pascal[n-1][k]
        return pascal

class Solution(object):
    def generate(self, numRows):
        """
        :type numRows: int
        :rtype: List[List[int]]
        """

        if numRows == 0:
            return []
        if numRows == 1:
            return [[1]]

        triangle = [[1]]

        for i in range(1, numRows):
            row = [1]
            for j in range(1, i):
                row.append(triangle[i-1][j-1] + triangle[i-1][j])
            row.append(1)
            triangle.append(row)

        return triangle

