class Solution(object):
    def fallingSquares(self, positions):
        """
        :type positions: List[List[int]]
        :rtype: List[int]
        """

        res = [0] * len(positions)
        for i, (left1, size1) in enumerate(positions):
            right1 = left1 + size1
            res[i] += size1
            for j in range(i):
                left2, size2 = positions[j]
                right2 = left2 + size2
                if right1 > left2 and left1 < right2:
                    res[i] = max(res[i], res[j] + size1)
        for i in range(1, len(res)):
            res[i] = max(res[i], res[i - 1])
        return res

