class Solution(object):
    def isMatch(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: bool
        """

        length_s = len(s)
        length_p = len(p)

        # init all elements to None
        dp = [[None]*(length_p + 1) for i in range(length_s + 1)]

        # empty pattern can match with empty string
        dp[0][0] = True

        # empty pattern cannot match with any non-empty string
        for i in range(1, length_s + 1):
            dp[i][0] = False

        # Only '*' can match with empty string
        for j in range(1, length_p + 1):
            if p[j - 1] == '*':
                dp[0][j] = dp[0][j - 1]
            else:
                dp[0][j] = False

        for i in range(1, length_s + 1):
            for j in range(1, length_p + 1):
                if p[j - 1] == '*':
                    dp[i][j] = dp[i][j - 1] or dp[i - 1][j]
                elif p[j - 1] == '?' or s[i - 1] == p[j - 1]:
                    dp[i][j] = dp[i - 1][j - 1]
                else:
                    dp[i][j] = False

        return dp[length_s][length_p]

