class Solution(object):
    def findRedundantDirectedConnection(self, edges):
        """
        :type edges: List[List[int]]
        :rtype: List[int]
        """

        n = len(edges)
        parent = [0] * (n + 1)
        candidates = []
        for edge in edges:
            if parent[edge[1]] == 0:
                parent[edge[1]] = edge[0]
            else:
                candidates.append([parent[edge[1]], edge[1]])
                candidates.append(edge)
        def find(x):
            if parent[x] != x:
                parent[x] = find(parent[x])
            return parent[x]
        def union(x, y):
            parent[find(x)] = find(y)
        for i in range(1, n + 1):
            parent[i] = i
        for edge in edges:
            if [edge[0], edge[1]] != candidates[1]:
                if find(edge[0]) == find(edge[1]):
                    if candidates[0] == []:
                        return edge
                    return candidates[0]
                union(edge[0], edge[1])
        return candidates[1]

