class Solution(object):
    def checkRecord(self, n):
        """
        :type n: int
        :rtype: int
        """

        MOD = 10**9 + 7
        if n == 1:
            return 3
        if n == 2:
            return 8
        if n == 3:
            return 19

        dp = [1, 2, 4, 7] + [0] * (n - 3)
        sums = [1, 3, 7, 13] + [0] * (n - 3)

        for i in range(4, n + 1):
            dp[i] = (dp[i - 1] + dp[i - 2] + dp[i - 3]) % MOD
            sums[i] = (sums[i - 1] + dp[i]) % MOD

        result = (dp[n] + MOD) % MOD

        for i in range(n):
            result += dp[i] * ((dp[n - 1 - i] + MOD - (0 if n - i - 2 < 0 else dp[n - i - 2])) % MOD)
            result %= MOD

        return result

