split-array-largest-sum.solution:
class Solution(object):
    def splitArray(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """

        def is_possible(mid):
            cuts, curr_sum = 0, 0
            for num in nums:
                curr_sum += num
                if curr_sum > mid:
                    cuts, curr_sum = cuts + 1, num
            subs = cuts + 1
            return subs <= k

        left, right = max(nums), sum(nums)
        while left < right:
            mid = left + (right - left) // 2
            if is_possible(mid):
                right = mid
            else:
                left = mid + 1
        return left

