class Solution(object):
    def nearestPalindromic(self, n):
        """
        :type n: str
        :rtype: str
        """

        def build_palindrome(n, is_odd):
            half = n[:len(n) // 2]
            half = str(int(half) - 1) if is_odd else half
            half = str(int(half) + 1) if int(n) >= int(half + half[::-1]) else half
            return half + (half[:-1][::-1] if is_odd else half[::-1])

        if int(n) < 10 or int(n[::-1]) == 1:
            return str(int(n) - 1)
        if n == '11':
            return '9'
        if n == str(10 ** (len(n) - 1) + 1):
            return str(10 ** (len(n) - 1) - 1)
        if n == str(10 ** (len(n) - 1) - 1):
            return str(10 ** (len(n) - 1) + 1)
        if n == str(10 ** len(n) + 1):
            return str(10 ** len(n) - 1)
        if n == str(10 ** len(n) - 1):
            return str(10 ** len(n) + 1)

        is_odd = len(n) % 2
        return min(
            build_palindrome(n, is_odd),
            '1' + '0' * (len(n) - 1) + '1',
            '9' * (len(n) - 1),
            key=lambda x: (abs(int(x) - int(n)), int(x))
        )


