    def canCross(self, stones):
        """
        :type stones: List[int]
        :rtype: bool
        """

        if stones[1] != 1:
            return False

        dp = [set() for _ in range(len(stones))]
        dp[1].add(1)

        stone_set = set(stones)

        for i in range(2, len(stones)):
            for j in range(i):
                diff = stones[i] - stones[j]
                if diff - 1 in dp[j] or diff in dp[j] or diff + 1 in dp[j]:
                    dp[i].add(diff)

