class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """

        if len(s) == 0:
            return 0
        max_len = 0
        start = 0
        char_dict = {}
        for i in range(len(s)):
            if s[i] in char_dict and char_dict[s[i]] >= start:
                start = char_dict[s[i]] + 1
            else:
                max_len = max(max_len, i - start + 1)
            char_dict[s[i]] = i
        return max_len

