class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """

        from collections import Counter
        if not s or not words:
            return []
        wordBag = Counter(words)  
        wordLen, numWords = len(words[0]), len(words)
        totalLen, res = wordLen*numWords, []
        for i in range(len(s)-totalLen+1):
            if Counter(self.fetchWords(s, i, wordLen, numWords)) == wordBag:
                res.append(i)
        return res

    def fetchWords(self, s, start, wordLen, numWords):
        return [s[start+i*wordLen:start+(i+1)*wordLen] for i in range(numWords)]

