        for i in range(min(len(v1), len(v2))):
            if v1[i] > v2[i]:
                return 1
            elif v1[i] < v2[i]:
                return -1

        if len(v1) > len(v2):
            return 1
        elif len(v1) < len(v2):
            return -1
