class Solution(object):
    def minStickers(self, stickers, target):
        """
        :type stickers: List[str]
        :type target: str
        :rtype: int
        """

        def minStickersHelper(dp, target):
            if target in dp:
                return dp[target]
            res, n, count = float('inf'), len(target), [0] * 26
            for i in range(n):
                count[ord(target[i]) - ord('a')] += 1
            for sticker in stickers:
                if sticker[ord(target[0]) - ord('a')] == 0:
                    continue
                sCount = [0] * 26
                for letter in sticker:
                    sCount[ord(letter) - ord('a')] += 1
                candidate = ''
                for i in range(26):
                    if count[i] - sCount[i] > 0:
                        candidate += chr(i + ord('a')) * (count[i] - sCount[i])
                candidate = minStickersHelper(dp, candidate)
                if candidate != -1:
                    res = min(res, 1 + candidate)
