sliding-window-maximum.solution:
class Solution(object):
    def maxSlidingWindow(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """

        if not nums: return []
        if k == 1: return nums

        deque = collections.deque()
        res = []

        for i in range(len(nums)):
            while deque and nums[i] > deque[-1]:
                deque.pop()
            deque.append(nums[i])

            if i >= k-1:
                res.append(deque[0])
                if nums[i-k+1] == deque[0]:
                    deque.popleft()
        return res

