class Solution(object):
    def getRow(self, rowIndex):
        """
        :type rowIndex: int
        :rtype: List[int]
        """

        if rowIndex == 0:
            return [1]
        if rowIndex == 1:
            return [1,1]

        prev = [1,1]
        for i in range(2, rowIndex+1):
            curr = [1]*(i+1)
            for j in range(1, i):
