class Solution(object):
    def isRectangleCover(self, rectangles):
        """
        :type rectangles: List[List[int]]
        :rtype: bool
        """

        area = 0
        corners = set()
        a = lambda: (Y-y) * (X-x)
        x, y, X, Y = min(x for x, y, X, Y in rectangles), min(y for x, y, X, Y in rectangles), max(X for x, y, X, Y in rectangles), max(Y for x, y, X, Y in rectangles)
        for xi, yi, Xi, Yi in rectangles:
            area += a()
            corners ^= {(xi, yi), (xi, Yi), (Xi, yi), (Xi, Yi)}
        return area == a() and corners == {(x, y), (x, Y), (X, y), (X, Y)}

