        """
        :type password: str
        :rtype: int
        """

        def check(s):
            lower = upper = digit = False
            for i in range(len(s)):
                if s[i].islower(): lower = True
                if s[i].isupper(): upper = True
                if s[i].isdigit(): digit = True
            return lower and upper and digit

