            res = 0
            A = B = C = 0
            for i in range(len(s)):
                if s[i].islower(): A += 1
                if s[i].isupper(): B += 1
                if s[i].isdigit(): C += 1
            return max(A, B, C)

        def insert(s):
            res = 0
