        if len(password) < 6:
            if check(password):
                return 6 - len(password)
            else:
                return max(6 - len(password), count(password))
        elif len(password) > 20:
            if check(password):
                return len(password) - 20
            else:
                return max(len(password) - 20, count(password))
        else:
            if check(password):
                return 0
            else:
                return count(password)

