class Solution(object):
    def intersectionSizeTwo(self, intervals):
        """
        :type intervals: List[List[int]]
        :rtype: int
        """

        intervals.sort(key=lambda x: (x[1], -x[0]))
        cur = [intervals[0][1]-1, intervals[0][1]]
        res = 2
        for interval in intervals[1:]:
            if cur[0] < interval[0] and interval[0] <= cur[1]:
                if interval[1] > cur[1]:
                    cur = [cur[1], interval[1]]
                    res += 1
                else:
                    cur = [cur[0], cur[1]-1]
                    res += 1
            elif cur[1] < interval[0]:
                cur = [interval[1]-1, interval[1]]
                res += 2
        return res

