number-of-atoms.solution:
class Solution(object):
    def countOfAtoms(self, formula):
        """
        :type formula: str
        :rtype: str
        """

        def parse(formula, i):
            counts = collections.defaultdict(int)
            while i < len(formula):
                if formula[i] == '(':
                    sub_counts, i = parse(formula, i + 1)
                    count = self.parse_num(formula, i)
                    for atom, v in sub_counts.iteritems():
                        counts[atom] += v * count
                elif formula[i] == ')':
                    i += 1
                    return counts, i
                else:
                    atom = self.parse_atom(formula, i)
                    i += len(atom)
                    count = self.parse_num(formula, i)
                    counts[atom] += count
            return counts, i

        def parse_atom(formula, i):
            j = i + 1
            while j < len(formula) and formula[j].islower():
                j += 1
            return formula[i:j]

        def parse_num(formula, i):
            j = i
            while j < len(formula) and formula[j].isdigit():
                j += 1
            return int(formula[i:j] or 1)

        counts, _ = parse(formula, 0)
        return ''.join(atom + (str(count) if count > 1 else '') for atom, count in sorted(counts.items()))

class Solution(object):
    def countOfAtoms(self, formula):
        """
        :type formula: str
        :rtype: str
        """

        def parse(formula, idx):
