class Solution(object):
    def findMinMoves(self, machines):
        """
        :type machines: List[int]
        :rtype: int
        """

        total = sum(machines)
        n = len(machines)
        if total % n:
            return -1
        avg = total // n
        leftSum = 0
        res = 0
        for num in machines:
            rightSum = total - leftSum - num
            if num > avg:
                if leftSum < avg * (n - 1):
                    res = max(res, num - avg - leftSum)
                if rightSum < avg * (n - 1):
                    res = max(res, num - avg - rightSum)
            else:
                if leftSum > avg * (n - 1) or rightSum > avg * (n - 1):
                    res = max(res, abs(leftSum - avg * (n - 1)), abs(rightSum - avg * (n - 1)))
            leftSum += num
        return res

