class Solution(object):
    def findKthNumber(self, m, n, k):
        """
        :type m: int
        :type n: int
        :type k: int
        :rtype: int
        """

        def enough(x):
            count = 0
            for i in range(1, m+1):
                count += min(x // i , n)
            return count >= k

        lo, hi = 1, m * n + 1
        while lo < hi:
            mi = (lo + hi) / 2
            if not enough(mi):
                lo = mi + 1
            else:
                hi = mi
        return lo


if __name__ == "__main__":
    s = Solution()
    print(s.findKthNumber(3, 3, 5))
    print(s.findKthNumber(2, 3, 6))

