class Solution(object):
    def maximalRectangle(self, matrix):
        """
        :type matrix: List[List[str]]
        :rtype: int
        """

        if not matrix or not matrix[0]:
            return 0
        n, m = len(matrix), len(matrix[0])
        height = [0] * (m+1)
        ans = 0
        for row in matrix:
            for i in range(m):
                height[i] = height[i] + 1 if row[i] == '1' else 0
            stack = [-1]
            for i in range(m+1):
                while height[i] < height[stack[-1]]:
                    h = height[stack.pop()]
                    w = i - 1 - stack[-1]
                    ans = max(ans, h * w)
                stack.append(i)
        return ans

class Solution(object):
    def maximalRectangle(self, matrix):
        """
        :type matrix: List[List[str]]
        :rtype: int
        """

        if not matrix or not matrix[0]:
            return 0
        n, m = len(matrix), len(matrix[0])
        height = [0] * m
        left = [0] * m
        right = [m] * m
        maxA = 0
        for i in range(n):
            cur_left, cur_right = 0, m
            for j in range(m):
                if matrix[i][j] == '1':
                    height[j] += 1
                else:
                    height[j] = 0
            for j in range(m):
                if matrix[i][j] == '1':
                    left[j] = max(left[j], cur_left)
                else:
                    left[j] = 0
                    cur_left = j + 1
            for j in range(m-1, -1, -1):
                if matrix[i][j] == '1':
                    right[j] = min(right[j], cur_right)
                else:
                    right[j] = m
                    cur_right = j
            for j in range(m):
                maxA = max(maxA, height[j] * (right[j] - left[j]))
        return maxA

