class Solution(object):
    def isNumber(self, s):
        """
        :type s: str
        :rtype: bool
        """

        def isInteger(s):
            return re.match("^[+-]?\d+$", s) is not None

        def isDecimal(s):
            return re.match("^[+-]?\d*\.?\d+$", s) is not None

        e = s.find('e')
        if e == -1:
            e = s.find('E')
        if e == -1:
            return isDecimal(s)
        else:
            return (isDecimal(s[:e]) or isInteger(s[:e])) and isInteger(s[e+1:])

