class Solution(object):
    def solveSudoku(self, board):
        """
        :type board: List[List[str]]
        :rtype: None Do not return anything, modify board in-place instead.
        """

        def is_valid(board, row, col, num):
            for x in range(9):
                if board[row][x] == num:
                    return False

            for x in range(9):
                if board[x][col] == num:
                    return False

            start_row = row - row % 3
            start_col = col - col % 3
            for i in range(3):
                for j in range(3):
                    if board[i + start_row][j + start_col] == num:
                        return False
            return True

        def solve_sudoku(board):
            for i in range(9):
                for j in range(9):
                    if board[i][j] == '.':
                        for num in '123456789':
                            if is_valid(board, i, j, num):
                                board[i][j] = num
                                if solve_sudoku(board):
                                    return True
                                board[i][j] = '.'
                        return False
            return True

        if not board:
            return None
        solve_sudoku(board)

