class Solution(object):
    def countBits(self, n):
        """
        :type n: int
        :rtype: List[int]
        """

        def count_ones(x):
            ones = 0
            while x > 0:
                ones += x & 1
                x >>= 1
            return ones

        return [count_ones(i) for i in range(n+1)]

