class Solution(object):
    def findWords(self, board, words):
        """
        :type board: List[List[str]]
        :type words: List[str]
        :rtype: List[str]
        """

        trie = {}
        for word in words:
            node = trie
            for letter in word:
                node = node.setdefault(letter, {})
            node['#'] = '#'
        self.res = []
        self.board = board
        for i in range(len(board)):
            for j in range(len(board[0])):
                if board[i][j] in trie:
                    self.dfs(i, j, trie)
        return self.res

    def dfs(self, i, j, trie):
        letter = self.board[i][j]
        dx = [-1, 1, 0, 0]
        dy = [0, 0, -1, 1]
        self.board[i][j] = '$'
        node = trie[letter]
        if '#' in node:
            self.res.append(node['#'])
            del node['#']
        for k in range(4):
            x = i + dx[k]
            y = j + dy[k]
            if 0 <= x < len(self.board) and 0 <= y < len(self.board[0]) and self.board[x][y] in node:
                self.dfs(x, y, node)
        self.board[i][j] = letter
        if not node:
            trie.pop(letter)

