class Solution(object):
    def wordPattern(self, pattern, s):
        """
        :type pattern: str
        :type s: str
        :rtype: bool
        """

        words = s.split()
        if len(words) != len(pattern):
            return False

        p_to_w = {}
        w_to_p = {}

        for p, w in zip(pattern, words):
            if p not in p_to_w and w not in w_to_p:
                p_to_w[p] = w
                w_to_p[w] = p
            elif (p in p_to_w and p_to_w[p] != w) or (w in w_to_p and w_to_p[w] != p):
                return False

        return True

