class Solution(object):
    def numberOfArithmeticSlices(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        n = len(nums)
        dp = [{} for _ in range(n)]
        res = 0
        for i in range(n):
            for j in range(i):
                diff = nums[i] - nums[j]
                if diff not in dp[j]:
                    dp[j][diff] = 1
                else:
                    dp[j][diff] += 1
                if diff in dp[i]:
                    res += dp[i][diff]
                if diff in dp[j]:
                    dp[i][diff] += dp[j][diff]
        return res

