class Solution(object):
    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """

        def canForm(word, wordDict):
            if word in wordDict:
                return True
            for i in range(1, len(word)):
                if word[:i] in wordDict and canForm(word[i:], wordDict):
                    return True
            return False

        words.sort(key=len)
        wordDict = set()
        res = []
        for i in range(len(words)):
            if canForm(words[i], wordDict):
                res.append(words[i])
            wordDict.add(words[i])
        return res

